import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <div className="landing-page-container">
        <h1>Welcome to Memory App!</h1>
        <p>Hereâ€™s how you can get started:</p>
        <ol>
          <li><strong>Sign-In:</strong> Log in or create an account to begin.</li>
          <li><strong>Enter Journal Entries:</strong> Use the journal page to write your thoughts.</li>
          <li><strong>Search Entries:</strong> Find past entries using metadata and keywords.</li>
          <li><strong>Get Insights:</strong> Receive personalized mental health tips and insights.</li>
        </ol>
        <div className="landing-page-buttons">
          <Link to="/authpage">
            <button>Sign Up</button>
          </Link>
          <Link to="/journal">
            <button>Start Journal</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
